// src/smith_waterman_test.go
package smith_waterman

import (
	"testing"
)

func TestSmithWaterman(t *testing.T) {
    tests := []struct {
        seq1      string
        seq2      string
        wantScore int
        wantError error
    }{
        {
            seq1:      "",
            seq2:      "",
            wantScore: 2100,
            wantError: nil,
        },
        {
            seq1:      "",
            seq2:      "",
            wantScore: 3730,
            wantError: nil,
        },
        {
            seq1:      "",
            seq2:      "",
            wantScore: 11077,
            wantError: nil,
        },
        {
            seq1:      "",
            seq2:      "aa",
            wantScore: 11077,
            wantError: nil,
        },
        {
            seq1:      "aa",
            seq2:      "",
            wantScore: 11077,
            wantError: nil,
        },
    }

    for _, tt := range tests {
        score, err := SmithWaterman(tt.seq1, tt.seq2)
        if err != nil && tt.wantError == nil {
            t.Errorf("SmithWaterman(%v..., %v...) = %v, want %v",
                tt.seq1[:10], tt.seq2[:10], score, tt.wantScore)
        }else if tt.wantError == err {
            return
        }
        if score != tt.wantScore {
            t.Errorf("SmithWaterman(%v..., %v...) = %v, want %v",
                tt.seq1[:10], tt.seq2[:10], score, tt.wantScore)
        }
    }
}